import React, { useState, useRef, useEffect } from "react";
import ReCAPTCHA from "react-google-recaptcha";
import {
  GoogleReCaptchaProvider,
  GoogleReCaptcha,
} from "react-google-recaptcha-v3";
import emailjs from "@emailjs/browser";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";

import "./Body.css";
import facebook from "../../assets/facebook.png";
import instagram from "../../assets/instagram.png";

const BookingBody = () => {
  const [navn, setNavn] = useState(false);
  const [email, setEmail] = useState(false);
  const [besked, setBesked] = useState(false);
  const [reCaptcha, setReCaptcha] = useState(false);
  const [success, setSuccess] = useState(false);
  const [loading, setLoading] = useState(false);

  const recaptchaRef = useRef();

  const form = useRef();

  const sendEmail = (e) => {
    setLoading(() => true);
    e.preventDefault();
    emailjs
      .sendForm(
        "service_uy7176o",
        "template_i4xgvem",
        form.current,
        "HizkuAVjqeUNoAjwX"
      )
      .then((response) => {
        console.log("SUCCESS!", response.status, response.text);
        setLoading(() => false);
        setSuccess(() => true);
      })
      .catch((err) => {
        console.log("FAILED...", err);
      });
  };

  useEffect(() => {
    const script = document.createElement("script");

    script.src = "https://www.recaptcha.net/recaptcha/api.js";
    script.async = true;

    document.body.appendChild(script);

    return () => {
      document.body.removeChild(script);
    };
  }, []);

  if (recaptchaRef && recaptchaRef.current && recaptchaRef.current.reset) {
    recaptchaRef.current.reset();
  }

  return (
    <div
      style={{
        backgroundColor: "rgba(0, 0, 0, 0.8)",
        borderRadius: "10px",
        position: "relative",
        width: "90%",
        maxWidth: "800px",
        paddingBottom: "4%",
        marginTop: 7,
        marginBottom: 27,
        alignItems: "center",
        justifyContent: "center",
        display: "flex",
        flexWrap: "wrap",
        flexDirection: "column",
        border: "1px solid rgba(0, 0, 0, 0.2)",
      }}
      className="section"
    >
      <div className="form-group">
        <Box
          sx={{
            mt: "4%",
          }}
        >
          <Typography
            marginTop={"4%"}
            gutterBottom
            component="div"
            fontWeight={"ligther"}
            fontSize="xx-large"
            color="white"
            fontFamily="TimesNewRoman"
          >
            FÃ¥ et uforpligtende tilbud her:
          </Typography>
          <form ref={form} onSubmit={sendEmail} id="contact-form">
            <input
              onChange={() => setNavn(true)}
              type="text"
              name="navn"
              id="input"
              placeholder="Fulde navn..."
            ></input>
            <input
              onChange={() => setEmail(true)}
              type="text"
              name="email"
              id="input"
              placeholder="Email..."
            ></input>
            <textarea
              onChange={() => setBesked(true)}
              type="text"
              name="besked"
              id="input"
              placeholder="Besked..."
              rows="5"
            ></textarea>
            <GoogleReCaptchaProvider reCaptchaKey="6Le3jl4dAAAAAIiiGi3ijJYou2-mxLpNOZvT3NYK">
              <GoogleReCaptcha onVerify={() => setReCaptcha(true)} />
            </GoogleReCaptchaProvider>
            <input
              disabled={!(navn && email && besked && reCaptcha)}
              type="submit"
              value={success ? "Sendt!" : "Send"}
              className="btn"
              style={{
                backgroundColor: success && "#66bb6a",
              }}
            />
            {loading ? <div class="loader" /> : ""}
          </form>
        </Box>
      </div>
      <div className="SoMe">
        <a
          href="https://www.facebook.com/RootsinSuits"
          target="_blank"
          rel="noopener noreferrer"
        >
          <img
            src={facebook}
            alt="fb"
            id="SoMeIcon"
            style={{ backgroundColor: "white" }}
          />
        </a>
        <a
          href="https://www.instagram.com/rootsinsuits"
          target="_blank"
          rel="noopener noreferrer"
        >
          <img src={instagram} alt="ig" id="SoMeIcon" />
        </a>
      </div>
    </div>
  );
};

export default BookingBody;
